pragma solidity ^0.5.0;
contract Diploma {
 // uint public blockCount = 0; //unsigned int pour compter le nombre de block dans la blockchain
// structure de notre block
  struct Diplome {
    //uint id_block;
    uint matricule;
    string nom; 
    string prenom;
    string university;
    string speciality;
    string Date;
    //string Departement;
    bool added; //esque la transaction est deja ajout au blockchain ou pas (initialis tjr par false)
    mapping(address => bool) isvalidated; //table li fiha chasue address de nos address li lzm yvalidiw w ida ils ont valider wla mzal 
    uint nbvalidation; //nombre de personnes qui ont valider ce diplome (initialis par 0)
  }

    mapping(address => mapping(uint => Diplome)) public diplomess;
    mapping(address => uint) public _blockCount;
  // 1-----> diplome1 
  // 2-----> diplome2
   Diplome[] public diplomes;
   address[] public owners; //les addresses des owners (qui doivent valider avant avant executer la transaction (ajouter le diplome a la blockchain))
   mapping(address => bool) public isOwner;
   uint public numConfirmationsRequired;
   //wesh nsauvgardiw f log lors de l'evenement create diplome 
   event CreateDiplome(
        uint matricule,
        uint indexed blockCount, 
        address indexed owner
    );
    event ValidateDiplome(address indexed owner, uint indexed blockCount);
   // event RevokeConfirmation(address indexed owner, uint indexed _blockCount);
    event AddDiplome(address indexed owner, uint indexed blockCount,bool added);



//pour verifier que le block sender (message sender) appartient a notre liste d'addresses owner!
  modifier onlyOwner() { 
        require(isOwner[msg.sender], "not owner");
        _;
    }


//pour verifier que le block sender (message sender) est bien le departement car que lui qui peur creer un diplome!
  modifier onlydept() { 
        require(msg.sender==owners[0], "not departement"); //reminder : nwerilhom que ca marche pas ki ndirha a 1 then nwerilhom bli tkhrej erreur et ca ne compile pas 
        _;
    }

    modifier diplomeExists(uint matricule) {
        int i= getdiplomeIndex(matricule);
        require(i==-1, "diplome exist"); 

        _;
    }
    modifier dipExists(uint _blockCount) {
        require(_blockCount < diplomes.length, "diplome does not exist");
        _;
    }

    modifier notadded(uint _blockCount) {
        require(!diplomes[_blockCount].added, "diplome already validated and added to the blockchain");
        _;
    }

    modifier notvalidated(uint _blockCount) {
        require(!diplomes[_blockCount].isvalidated[msg.sender], "diplome already validated");
        _;
    }



  constructor(address[] memory _owners, uint _numConfirmationsRequired) public {
    require(_owners.length > 0, "owners required");
        require(
            _numConfirmationsRequired > 0 && _numConfirmationsRequired <= _owners.length,
            "invalid number of required confirmations"
        );

        for (uint i = 0; i < _owners.length; i++) {
            address owner = _owners[i];

            require(owner != address(0), "invalid owner");
            require(!isOwner[owner], "owner not unique");

            isOwner[owner] = true;
            owners.push(owner);
        }

    numConfirmationsRequired = _numConfirmationsRequired;

    //createDiplome(181839024387,"MAAMERi","Kenza","USTHB","SSI","25/03/2022");//,"Informatique");
    //createDiplome(181839024389,"HAICHEUR","Amani","USTHB","SII","25/03/2022");//,"Informatique");
    //createDiplome(181839024388,"BENALLOU","Adel","USTHB","SSI","25/03/2022");//,"Informatique");
  }




//creating diplome for the first time from the departement
  function createDiplome(uint  matricule,string memory nom,string memory prenom,string memory university,string memory speciality,string memory Date) 
    public
        onlydept
        diplomeExists(matricule)
    {
      uint blockCount =diplomes.length; //nombre de bloc non valid (en attente de validation)
        diplomes.push( Diplome(matricule,nom,prenom,university,speciality,Date,false,0));

        emit CreateDiplome(matricule, blockCount ,msg.sender);
    
    
    
  }


  
//validate the diplom from faculty,rectorat,
function validateDiplome(uint _blockCount)
        public
        onlyOwner
        dipExists(_blockCount)
        notadded(_blockCount)
        notvalidated(_blockCount)
    {
        Diplome storage diplome = diplomes[_blockCount];

        diplome.isvalidated[msg.sender] = true;
        diplome.nbvalidation += 1;
        bool _added;

        if(diplome.nbvalidation >= numConfirmationsRequired)
        {
        diplome.added = true;
        _added=diplome.added;
        
        }
        emit ValidateDiplome(msg.sender, _blockCount);
    }
 /* function validate()
  { 
    //if c bon validaw kamel 
    diplomevalide[]=Diplome(blockCount,matricule,nom,prenom,university,speciality,Date,Departement,false);
  }
*/

 function addDiplome(uint _blockCount)
        public
        onlyOwner
        dipExists(_blockCount)
        notadded(_blockCount)
    { bool _added;
        Diplome storage diplome = diplomes[_blockCount];

        require(
            diplome.nbvalidation >= numConfirmationsRequired,
            "cannot add diplome"
        );

        diplome.added = true;
        _added=diplome.added;
       /* (bool success, ) = diplome.to.call.value(diplome.value)(diplome.data);
        require(success, "tx failed");
*/
        emit AddDiplome(msg.sender, _blockCount,_added);
    }






 function getOwners() public view returns (address[] memory) {
        return owners;
    }

    function getdiplomesCount() public view returns (uint) {
        return diplomes.length;
    }

    function getdiplome(uint _blockCount)
        public
        view
        returns ( uint matricule, uint nbvalidation,bool added)
    {
        Diplome storage diplome = diplomes[_blockCount];

        return (
            diplome.matricule,
            diplome.nbvalidation,
            diplome.added
        );
    }

    function getdiplomeIndex(uint mmatricule)
        public
        view
        returns (int index)
    { bool x;
    int index=-1;
        Diplome memory diplome;
       if(diplomes.length==0)
       {
           return -1; 
       }
         for (uint i = 0; i < diplomes.length; i++) {
        diplome=diplomes[i];
            if(diplome.matricule==mmatricule)
           {
                 x==true;
                index=int(i);
                return(index);
            }

         }
         return(index);
        
    }
    function isConfirmed(uint _blockCount, address _owner)
        public
        view
        returns (bool)
    {
        Diplome storage diplome = diplomes[_blockCount];

        return diplome.isvalidated[_owner];
    }
}
